import React from "react";
import classes from "./chooseBtn.module.scss";
import AngleDown from "../../trifles/icons/AngleDown";
import Modal from "../modals/Modal";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faAngleDown } from "@fortawesome/free-solid-svg-icons";

const ChooseBtn = ({ modal, setModal }) => {
  const categories = [
    "Bakery",
    "Fruit and vegetables",
    "Meat and fish",
    "Drinks",
    "Kitchen",
    "Special nutrition",
    "Baby",
    "Pharmacy",
  ];

  return (
    <>
      <button
        className={classes.chooseBtn}
        onClick={(e) => {
          e.preventDefault();
          setModal(true);
        }}
      >
        All categories
        <FontAwesomeIcon icon={faAngleDown} />
      </button>
      <Modal setVisible={setModal} modal={modal}></Modal>
    </>
  );
};

export default ChooseBtn;
